import { Typography } from "@material-ui/core";
import React from "react";
import BarChart from "./BarChart";
import PieChart from "./PieChart";
import ReactPlayer from "react-player/youtube";
import homeImage from "./images/homeImage.jpg";
import paddle from "./images/paddle.png";

export default function Home() {
  return (
    <div>
      <div >
        <div styles={{
          margin: '0px',
          padding: '0px'
        }}>
          <img src={homeImage} className="homeImage" alt={"homeImage"} width="500px"/>
        </div>
        <div>
          <img src={paddle} className="paddle" alt={"paddle"} width="500px"/>
        </div>
      </div>

      <div
        style={{
          display: "flex",
          width: "100%",
          height: "100%",
          flexFlow: "column",
          alignItems: "center",
        }}
      >
        <Typography h1>Charts</Typography>
        <div
          className="playerContainer"
          style={{ display: "flex", width: "500px" }}
        >
          <ReactPlayer
            url="https://www.youtube.com/watch?v=TAEkR13ChPs"
            stopOnUnmount={false}
            playing="true"
            width="100%"
            height="20em"
          />
        </div>
        <div
          className="ChartsHolder"
          style={{ display: "flex", justifyContent: "space-between" }}
        >
          <div>
            <BarChart />
          </div>
          <div>
            <PieChart />
          </div>
        </div>
      </div>
    </div>
  );
}
